pragma solidity >=0.4.22;
pragma experimental ABIEncoderV2;

import "./../libraries/augur/source/contracts/trading/CompleteSets.sol";
import "./../libraries/augur/source/contracts/trading/ICash.sol";
import "./../libraries/augur/source/contracts/reporting/IMarket.sol";

import "./../libraries/openzeppelin-solidity/SafeMathLib.sol";

import "./../libraries/0x/contracts/exchange/contracts/src/interfaces/IExchange.sol";
import "@0x/contracts-exchange-libs/contracts/src/LibOrder.sol";
import './WrappedAugurShare.sol';

contract Broker {
	using SafeMathLib for uint256;

	CompleteSets constant private completeSets = CompleteSets(0x48FCc9d538B9C86bA9D35b3eB0e7f64EE2B4664f); // rinkeby
	address constant private cash = 0x2Da4d465978981BD75BbaC4C9f3bdA10bE0B465c;
	address constant private augur = 0x990B2D2aF7e87cd015A607c3A95d7622c9bBeDe1;
	IExchange constant private exchange = IExchange(0xbCE0B5F6eb618c565C3E5f5cd69652bbC279f44E);

	constructor(
	) 
	public 
	{
		ICash(cash).approve(augur, uint256(-1));
	}

	function getShareTokens(IMarket _market) public view returns(address no , address yes){
		return (_market.getShareToken(0), _market.getShareToken(1));
	}

	function fillAugurOrders (
		IMarket _market,
		address[] _wrappedAugurShares,
		LibOrder.Order[] memory _orders,
		bytes[] _signatures
	)
	public 
	payable
	{
		uint256 amount = msg.value.div(_market.getNumTicks());
		completeSets.publicBuyCompleteSets.value(msg.value)(_market, amount);

		uint256 numberOfOutcomes = _market.getNumberOfOutcomes();
		require(numberOfOutcomes == 2);

		for (uint i = 0; i < numberOfOutcomes; i++) {
		 	address outcome = _market.getShareToken(i);
			WrappedAugurShare wrappedShare = WrappedAugurShare(_wrappedAugurShares[i]);
			ERC20(outcome).approve(_wrappedAugurShares[i], amount);
			wrappedShare.depositAndApprove(amount, address(this), amount);
			exchange.fillOrder(_orders[i], amount, _signatures[i]);
		}

		// TODO fill orders with WAS 
		// TODO Unwrap returned WETH
		// TODO return Weth to msg.sender
	}
}
